import React, { Component } from 'react';
import { MenuItems } from "./MenuItems"
import { AuthMenuItems } from "./MenuItems"
import './Navbar.css'

const navbar = ({ isAuthenticated }) => {

	let renderLinks = isAuthenticated ? AuthMenuItems : MenuItems;

	return (
		
    class Navbar extends Component {
        state = { clicked: false }

        handleClick = () => {
            this.setState({ clicked: !this.state.clicked})
        }


        render() {
            return(
                <nav className="NavbarItems">
                    <h1 className="navbar-logo"><i className="fab site-logo"><img src="https://cdn.discordapp.com/attachments/784159525657378829/784740718324219904/helpmehelpyou-01.png" height="80px;"/></i></h1>
                    <div className="menu-Icon" onClick={this.handleClick}>
                        <i className={this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
                    </div>
                    <ul className={this.state.clicked ? 'nav-menu active' : 'nav-menu'}>
                        {MenuItems.map((item, index) => {
                            return (
                                <li key={index}>
                                    <a className={item.cName} href="item.url">
                                    {item.title}
                                    </a>
                                </li>
                            )
                        })}
                    </ul>
                </nav>
            )
        }
    }


	);
};

const mapStateToProps = (state) => ({
	isAuthenticated: state.auth.isAuthenticated
});


export default navbar
